export default function Concepts(props) {
    return (
        <div>
            <ul id='concepts'>
                <li className='concept'>
                    <img src={props.image} alt={props.items[0].title} />
                    <h2>{props.items[0].title}</h2>
                    <p>{props.items[0].description}</p>
                </li>
            </ul>
        </div>
    )
}
